	(2795, 'A clone is an identical copy of a living creature.', 'Scientists recently made a clone of a sheep.', 2795, 1, '2022-10-17 00:07:42', '2022-10-17 00:07:42'),
	(2796, 'Colloquial describes informal words that are more suitable for speech than writing.', 'I find it difficult to understand people if they use colloquial language.', 2796, 3, '2022-10-17 00:08:02', '2022-10-17 00:08:02'),
	(2797, 'Cosmetics are substances that make the face and skin more beautiful.', 'Girls often look nicer when they don’t use so many cosmetics.', 2797, 1, '2022-10-17 00:08:21', '2022-10-17 00:08:21'),
	(2798, 'To dash means to run or move quickly.', 'Helen dashed up the stairs, so she wouldn’t be late for her appointment.', 2798, 2, '2022-10-17 00:08:52', '2022-10-17 00:08:52'),
	(2799, 'Disgust is a feeling of distaste and anger caused by something rude or unpleasant.', 'He felt disgust toward his date because she had such terrible eating habits.', 2799, 1, '2022-10-17 00:09:06', '2022-10-17 00:09:06'),
	(2800, 'If something is fluorescent, it is such a bright color that it seems to give off light.', 'She highlighted the key words in the document with a fluorescent yellow pen.', 2800, 3, '2022-10-17 00:09:25', '2022-10-17 00:09:25'),
	(2801, 'If you are furious, you are extremely angry.', 'My father was furious when he read my bad school report.', 2801, 3, '2022-10-17 00:09:39', '2022-10-17 00:09:39'),
	(2802, 'A gulf is a gap between people who do not understand each other.', 'There has been a gulf between James and Tony since their parents died.', 2802, 1, '2022-10-17 00:09:53', '2022-10-17 00:09:53'),
	(2803, 'Humanities are subjects which analyze human ideas, such as history and literature.', 'Jennifer has always been more interested in humanities than science.', 2803, 1, '2022-10-17 00:10:05', '2022-10-17 00:10:05'),
	(2804, 'A knot is made when you tie the ends of rope or cord together.', 'He tied a knot in his shoelaces, so they wouldn’t come off during the race.', 2804, 1, '2022-10-17 00:10:18', '2022-10-17 00:10:18'),
	(2805, 'A linguist is someone who studies languages.', 'Tony is a good linguist and speaks four different languages.', 2805, 1, '2022-10-17 00:10:31', '2022-10-17 00:10:31'),
	(2806, 'A participant is someone who joins in a social event or competition.', 'There were thousands of participants in this year’s marathon.', 2806, 1, '2022-10-17 00:10:45', '2022-10-17 00:10:45'),
	(2807, 'If something is plausible, it is reasonable or possible.', 'It is plausible that Jack isn’t here today because he is sick.', 2807, 3, '2022-10-17 00:10:59', '2022-10-17 00:10:59'),
	(2808, 'A ritual is a formal custom that people do regularly.', 'Ken was very interested to learn about the religious rituals of the natives.', 2808, 1, '2022-10-17 00:11:12', '2022-10-17 00:11:12'),
	(2809, 'A sibling is a brother or sister.', 'Jane has two siblings, an older brother and a younger sister.', 2809, 1, '2022-10-17 00:11:26', '2022-10-17 00:11:26'),
	(2810, 'If someone is skinny, they are extremely thin.', 'Polly is very skinny. I think she needs to eat more.', 2810, 3, '2022-10-17 00:11:39', '2022-10-17 00:11:39'),
	(2811, 'If something is vague, it is not clear, and it gives very few details.', 'I asked him about his mother’s health, but he was very vague about it.', 2811, 3, '2022-10-17 00:11:54', '2022-10-17 00:11:54'),
	(2812, 'An acid is a chemical that can burn or dissolve other substances.', 'In chemistry class, we mixed two acids together and watched the reaction.', 2812, 1, '2022-10-17 00:12:17', '2022-10-17 00:12:17'),
	(2813, 'An administration is the group of people who manage a company or organization.', 'She hoped she could be promoted to a job in the administration.', 2813, 1, '2022-10-17 00:12:31', '2022-10-17 00:12:31'),
	(2814, 'Administrative describes anything related to managing a company or organization.', 'I work as an administrative assistant to the owner of the company.', 2814, 3, '2022-10-17 00:12:44', '2022-10-17 00:12:44'),
	(2815, 'Biotechnology is the use of living parts, such as cells, in industry and technology.', 'Researchers at the biotechnology company use bacteria to make medicine.', 2815, 1, '2022-10-17 00:12:58', '2022-10-17 00:12:58'),
	(2816, 'Cholesterol is a substance in fat, tissues, and blood of all animals.', 'When people have too much cholesterol, they are at a high risk for heart problems.', 2816, 1, '2022-10-17 00:13:11', '2022-10-17 00:13:11'),
	(2817, 'A coalition is a group of people or organizations working for a common purpose.', 'The companies formed a coalition to make trade less expensive.', 2817, 1, '2022-10-17 00:13:27', '2022-10-17 00:13:27'),
	(2818, 'When something is deceptive, it encourages one to believe something that is false.', 'The scary-looking man’s appearance is deceptive, but he is actually very nice.', 2818, 3, '2022-10-17 00:13:40', '2022-10-17 00:13:40'),
	(2819, 'Diabetes is a medical condition where a person has too much sugar in their blood.', 'Overweight people are more likely to suffer from diabetes than slimmer ones.', 2819, 1, '2022-10-17 00:13:54', '2022-10-17 00:13:54'),
	(2820, 'To eliminate something that is unwanted means to completely remove it.', 'Wearing a seatbelt eliminates some of the dangers of driving a car.', 2820, 2, '2022-10-17 00:14:07', '2022-10-17 00:14:07'),
	(2821, 'Erosion is the destruction of rock or soil due to flowing water or weather.', 'Canyons are formed because rivers of fast-moving water caused erosion.', 2821, 1, '2022-10-17 00:14:20', '2022-10-17 00:14:20'),
	(2822, 'Ethics are moral beliefs or rules about right or wrong.', 'The act of stealing certainly doesn’t go against some people’s ethics.', 2822, 1, '2022-10-17 00:14:31', '2022-10-17 00:14:31'),
	(2823, 'If something is explicit, it is very clear, open, and truthful.', 'The man gave a very explicit account of the car accident.', 2823, 3, '2022-10-17 00:14:43', '2022-10-17 00:14:43'),
	(2824, 'A framework is a set of rules or ideas that people use to solve problems.', 'His ideas fit into the framework of a successful business plan.', 2824, 1, '2022-10-17 00:14:55', '2022-10-17 00:14:55'),
	(2825, 'To manufacture something means to make it in a factory.', 'My father’s company manufactures steel building materials.', 2825, 2, '2022-10-17 00:15:07', '2022-10-17 00:15:07'),
	(2826, 'A mechanism is a part of a machine that performs a certain function.', 'I can’t open my car door because the locking mechanism is broke.', 2826, 1, '2022-10-17 00:15:19', '2022-10-17 00:15:19'),
	(2827, 'To minimize means to reduce something to the lowest possible level.', 'I checked my homework twice to minimize errors I might have made.', 2827, 2, '2022-10-17 00:15:31', '2022-10-17 00:15:31'),
	(2828, 'Nectar is a sweet liquid produced by flowers that bees and other insects collect.', 'Bees use nectar to make their honey.', 2828, 1, '2022-10-17 00:15:44', '2022-10-17 00:15:44'),
	(2829, 'A notion is an idea or belief about something.', 'I have a notion that this route would get us to the beach.', 2829, 1, '2022-10-17 00:15:56', '2022-10-17 00:15:56'),
	(2830, 'When things are prone to some bad thing, they are likely affected by it.', 'Some people are more prone to catching colds than others.', 2830, 3, '2022-10-17 00:16:08', '2022-10-17 00:16:08'),
	(2831, 'When something is straightforward, it is good because it is easy to understand.', 'The teacher’s grading system was straightforward and fair.', 2831, 3, '2022-10-17 00:16:22', '2022-10-17 00:16:22'),
	(2832, 'If something is astronomical, then it is extremely large.', 'It’s an astronomical distance between the Milky Way galaxy and the nearest galaxy.', 2832, 3, '2022-10-17 00:16:40', '2022-10-17 00:16:40'),
	(2833, 'An atom is the smallest unit of a substance.', 'A molecule consists of a combination of two or more atoms.', 2833, 1, '2022-10-17 00:16:54', '2022-10-17 00:16:54'),
	(2834, 'Breadth is the distance from one side to the other side of something.', 'The breadth of the northern wall of the house is twenty meters.', 2834, 1, '2022-10-17 00:17:07', '2022-10-17 00:17:07'),
	(2835, 'A circumference is the distance completely around a circular object.', 'The circumference of the Earth is obviously much larger than a baseball’s.', 2835, 1, '2022-10-17 00:17:20', '2022-10-17 00:17:20'),
	(2836, 'A comet is an object in space made of ice and rock with a tail of glowing dust.', 'Comets take many decades to complete an orbit around a star.', 2836, 1, '2022-10-17 00:17:33', '2022-10-17 00:17:33'),
	(2837, 'A crater is a large hole in a planet’s or moon’s surface.', 'They could clearly see the big crater on the moon through the telescope.', 2837, 1, '2022-10-17 00:17:46', '2022-10-17 00:17:46'),
	(2838, 'A crescent is the curved shape lit on the moon’s face during its early and late stages.', 'Ten days ago the entire moon was bright, but now only a small crescent is shining.', 2838, 1, '2022-10-17 00:17:57', '2022-10-17 00:17:57'),
	(2839, 'Debris is the small pieces scattered from something wrecked or destroyed.', 'The debris from the cube scattered on the floor.', 2839, 1, '2022-10-17 00:18:08', '2022-10-17 00:18:08'),
	(2840, 'Despair is the complete loss of hope.', 'After the other company won the account, our salespeople were filled with despair.', 2840, 1, '2022-10-17 00:18:21', '2022-10-17 00:18:21'),
	(2841, 'To embed something means to place it firmly within a surrounding thing.', 'The logger embedded the ax into the wood after chopping several logs.', 2841, 2, '2022-10-17 00:18:34', '2022-10-17 00:18:34'),
	(2842, 'A fragment is a small part of something.', 'After the light broke, there were fragments of glass to clean up.', 2842, 1, '2022-10-17 00:18:45', '2022-10-17 00:18:45'),
	(2843, 'A galaxy is any extremely large collection of star systems.', 'Our solar system is located in the outer area of our galaxy.', 2843, 1, '2022-10-17 00:18:58', '2022-10-17 00:18:58'),
	(2844, 'If something is gigantic, then it is extremely large.', 'Some dinosaurs were so gigantic that they were the size of buildings.', 2844, 3, '2022-10-17 00:19:10', '2022-10-17 00:19:10'),
	(2845, 'Gloom is a state of being almost completely dark.', 'In the gloom of the morning, it was difficult to see the boat on the lake.', 2845, 1, '2022-10-17 00:19:22', '2022-10-17 00:19:22'),
	(2846, 'To radiate means to send out energy or heat.', 'The heat from the fireplace radiated throughout the room.', 2846, 2, '2022-10-17 00:19:34', '2022-10-17 00:19:34'),
	(2847, 'To roam means to move around without a plan or purpose.', 'All day the cows roamed around the field eating grass.', 2847, 2, '2022-10-17 00:19:49', '2022-10-17 00:19:49'),
	(2848, 'If something is solitary, then it is lonely or the only one.', 'The only thing in the room was a solitary chair.', 2848, 3, '2022-10-17 00:20:02', '2022-10-17 00:20:02'),
	(2849, 'The spectrum is the full range of color ranging from red to violet.', 'You can see the entire spectrum in a rainbow.', 2849, 1, '2022-10-17 00:20:15', '2022-10-17 00:20:15'),
	(2850, 'A sphere is a three-dimensional round shape, like a ball.', 'The balloons were inflated into a variety of colorful spheres.', 2850, 1, '2022-10-17 00:20:27', '2022-10-17 00:20:27'),
	(2851, 'Status is the position of something or someone in relation to others.', 'She had achieved the status of being the smartest girl in the class.', 2851, 1, '2022-10-17 00:20:38', '2022-10-17 00:20:38'),
	(2852, 'If someone is bankrupt, then they are unable to pay their debts.', 'The store had few customers and soon went bankrupt.', 2852, 3, '2022-10-17 00:20:58', '2022-10-17 00:20:58'),
	(2853, 'To conform to rules or laws is to obey them.', 'The new student had to conform to the school’s dress code.', 2853, 2, '2022-10-17 00:21:10', '2022-10-17 00:21:10'),
	(2854, 'To employ someone means to give work to them.', 'The bookstore employed two full-time clerks.', 2854, 2, '2022-10-17 00:21:22', '2022-10-17 00:21:22'),
	(2855, 'To expel someone means to force them to leave a place.', 'Since he would not follow the rules, the principal had to expel the student.', 2855, 2, '2022-10-17 00:21:34', '2022-10-17 00:21:34'),
	(2856, 'An extension is a part added to something to give it more time or space.', 'My parents decided to add an extension to our house for the new baby.', 2856, 1, '2022-10-17 00:21:46', '2022-10-17 00:21:46'),
	(2857, 'If something is forthcoming, then it is about to happen in the future.', 'Some economists predicted that the forthcoming world economy would be severe.', 2857, 3, '2022-10-17 00:22:16', '2022-10-17 00:22:16'),
	(2858, 'To furnish means to put furniture in a house or room.', 'Most homes are furnished with tables, chairs, and beds.', 2858, 2, '2022-10-17 00:22:30', '2022-10-17 00:22:30'),
	(2859, 'Hygiene is the conditions or methods needed for health and cleanliness.', 'People who brush their teeth at least twice a day are practicing good hygiene.', 2859, 1, '2022-10-17 00:22:44', '2022-10-17 00:22:44'),
	(2860, 'If something is hygienic, then it is clean and unlikely to cause disease.', 'My sister works very hard to keep her entire home as hygienic as possible.', 2860, 3, '2022-10-17 00:22:56', '2022-10-17 00:22:56'),
	(2861, 'A landlord is a man who rents property to a person.', 'The landlord collected everyone’s rent money on the first day of every month.', 2861, 1, '2022-10-17 00:23:10', '2022-10-17 00:23:10'),
	(2862, 'To lease means to rent property, usually an apartment or land.', 'When the family first leased the apartment, the rent was very low.', 2862, 2, '2022-10-17 00:23:22', '2022-10-17 00:23:22'),
	(2863, 'If something is mandatory, then it is required by law.', 'It’s mandatory that everyone be at least sixteen to drive a car in the US.', 2863, 3, '2022-10-17 00:23:36', '2022-10-17 00:23:36'),
	(2864, 'To mend something means to fix it when it is broken or damaged.', 'Mother mended the rip in my pants with a piece of cloth.', 2864, 2, '2022-10-17 00:23:48', '2022-10-17 00:23:48'),
	(2865, 'A mortgage is a loan for property, especially homes and businesses.', 'When they bought their new home, the married couple had to sign a mortgage.', 2865, 1, '2022-10-17 00:24:00', '2022-10-17 00:24:00'),
	(2866, 'Personnel are employees in a business.', 'When business increased, we had to hire more personnel.', 2866, 1, '2022-10-17 00:24:23', '2022-10-17 00:24:23'),
	(2867, 'Plumbing is the system of pipes used in a home to supply water.', 'When the plumbing stopped working, no one was allowed to use the toilets.', 2867, 1, '2022-10-17 00:24:35', '2022-10-17 00:24:35'),
	(2868, 'A tenant is a person who rents property from a landlord.', 'The new tenants moved into the house across the street.', 2868, 1, '2022-10-17 00:24:48', '2022-10-17 00:24:48'),
	(2869, 'If something is trendy, then it is very popular and new.', 'Carlo bought a trendy new car.', 2869, 3, '2022-10-17 00:25:02', '2022-10-17 00:25:02'),
	(2870, 'A utility is a business that supplies services such as water or electricity.', 'If you don’t pay the utilities, you may have your electricity turned off.', 2870, 1, '2022-10-17 00:25:17', '2022-10-17 00:25:17'),
	(2871, 'Whereby means by which or through which.', 'The mayor had a new bridge built whereby the citizens could cross the river.', 2871, 8, '2022-10-17 00:25:31', '2022-10-17 00:25:31'),
	(2872, 'If something is aesthetic, then it is concerned with a love of beauty.', 'The dresses were noteworthy for their aesthetic design.', 2872, 3, '2022-10-17 00:25:52', '2022-10-17 00:25:52'),
	(2873, 'If someone is arrogant, they think that they are more important than others.', 'He is very arrogant. Even though he’s not the boss, he tells everyone what to do.', 2873, 3, '2022-10-17 00:26:04', '2022-10-17 00:26:04'),
	(2874, 'A bias is a person’s likelihood to like one thing more than another thing.', 'The mothers had a natural bias for their own child’s picture.', 2874, 1, '2022-10-17 00:26:18', '2022-10-17 00:26:18'),
	(2875, 'A canyon is a narrow valley with steep walls through which a river often flows.', 'The canyon was so deep that the ground inside was covered in shadow.', 2875, 1, '2022-10-17 00:26:34', '2022-10-17 00:26:34'),
	(2876, 'A creek is a stream or small river.', 'Only small fish lived in the shallow waters of the creek.', 2876, 1, '2022-10-17 00:26:47', '2022-10-17 00:26:47'),
	(2877, 'A drill is a tool with a point that spins in order to make a hole.', 'The carpenter used the drill to make several holes in the wood.', 2877, 1, '2022-10-17 00:27:00', '2022-10-17 00:27:00'),
	(2878, 'An executive is the top manager of a business.', 'After twenty years at the company, he finally became the executive.', 2878, 1, '2022-10-17 00:27:12', '2022-10-17 00:27:12'),
	(2879, 'Fatigue is a feeling of extreme tiredness.', 'After three days with little sleep, she was feeling a lot of fatigue.', 2879, 1, '2022-10-17 00:27:24', '2022-10-17 00:27:24'),
	(2880, 'An incline is a sharp rise in something, especially a hill or mountain.', 'This mountain has one of the steepest inclines in the world.', 2880, 1, '2022-10-17 00:27:36', '2022-10-17 00:27:36'),
	(2881, 'If something is nasty, then it is not nice or pleasant.', 'The rotten apple left a nasty taste inside her mouth.', 2881, 3, '2022-10-17 00:27:47', '2022-10-17 00:27:47'),
	(2882, 'To perceive something means to be aware of it.', 'He was talking loudly, so he did not perceive that the music had stopped.', 2882, 2, '2022-10-17 00:27:59', '2022-10-17 00:27:59'),
	(2883, 'A primate is a type of mammal that includes monkeys, apes, and humans.', 'Primates use their hands for such tasks as swinging from branches.', 2883, 1, '2022-10-17 00:28:12', '2022-10-17 00:28:12'),
	(2884, 'If something is primitive, then it is simple, basic, and not very developed.', 'The computers of the 1980s are primitive compared to those of todays.', 2884, 3, '2022-10-17 00:28:25', '2022-10-17 00:28:25'),
	(2885, 'A stereotype is a general but often incorrect idea about a person or thing.', 'There’s a stereotype that pigs are dirty animals. But they are rather clean.', 2885, 1, '2022-10-17 00:28:37', '2022-10-17 00:28:37'),
	(2886, 'If something is sticky, then it is covered with a substance that things stick to.', 'Place the sticky part of the tape against the paper, so it will cling to the wall.', 2886, 3, '2022-10-17 00:28:50', '2022-10-17 00:28:50'),
	(2887, 'A termite is an insect that lives in groups and feeds on wood.', 'The wood we found was full of termites.', 2887, 1, '2022-10-17 00:29:01', '2022-10-17 00:29:01'),
	(2888, 'If something happens thereby an action, then it is the result of that action.', 'He didn’t score a goal, thereby ending his chance at setting a record.', 2888, 4, '2022-10-17 00:29:15', '2022-10-17 00:29:15'),
	(2889, 'A trail is a path through a wild area.', 'A narrow trail cut through the field and over the hills.', 2889, 1, '2022-10-17 00:29:27', '2022-10-17 00:29:27'),
	(2890, 'A twig is a short and thin branch from a tree or bush.', 'They started the fire with a handful of dry twigs.', 2890, 1, '2022-10-17 00:29:42', '2022-10-17 00:29:42'),
	(2891, 'Welfare is the health and happiness of a person or group.', 'Having plenty of clean water is necessary for the welfare of people.', 2891, 1, '2022-10-17 00:29:54', '2022-10-17 00:29:54'),
	(2892, 'If something is done on one’s behalf, it is done for that person by another.', 'The original speaker was sick, so his son gave the speech on his behalf.', 2892, 1, '2022-10-17 00:30:12', '2022-10-17 00:30:12'),
	(2893, 'To flap means to move quickly up and down or from side to side.', 'The tiny bird flapped its wings and ate from the flowers.', 2893, 2, '2022-10-17 00:30:24', '2022-10-17 00:30:24'),
	(2894, 'A glacier is a large piece of ice that moves very slowly.', 'The North Pole is covered by a huge glacier.', 2894, 1, '2022-10-17 00:30:35', '2022-10-17 00:30:35'),
	(2895, 'The globe refers to the Earth.', 'Water covers most of the globe.', 2895, 1, '2022-10-17 00:31:12', '2022-10-17 00:31:12'),
	(2896, 'When something is horizontal, it is flat and level with the ground.', 'The Russian flag has three horizontal stripes of white, blue, and red.', 2896, 3, '2022-10-17 00:31:28', '2022-10-17 00:31:28'),
	(2897, 'To hum means to make a low, continuous noise.', 'The man hummed his favorite song.', 2897, 2, '2022-10-17 00:31:43', '2022-10-17 00:31:43'),
	(2898, 'An inventory is a supply of something.', 'Gwen was checking the inventory to make sure we had what we needed.', 2898, 1, '2022-10-17 00:31:58', '2022-10-17 00:31:58'),
	(2899, 'If a thought or feeling is inward, it is not expressed or shown to others.', 'She had an inward feeling of guilt when she lied to her mother.', 2899, 3, '2022-10-17 00:32:13', '2022-10-17 00:32:13'),
	(2900, 'A loaf of bread is bread shaped and baked in one piece.', 'Could you please buy a loaf of bread for sandwiches?', 2900, 1, '2022-10-17 00:32:27', '2022-10-17 00:32:27'),
	(2901, 'An oracle is person who speaks with gods and gives advice about the future.', 'The king went to the oracle to ask if going to war was a good idea.', 2901, 1, '2022-10-17 00:32:40', '2022-10-17 00:32:40'),
	(2902, 'To orbit something means to move around it in a continuous, curving path.', 'The moon orbits the Earth.', 2902, 2, '2022-10-17 00:32:54', '2022-10-17 00:32:54'),
	(2903, 'An overview is a general description of a situation.', 'My brother gave me an overview of the important parts of the book.', 2903, 1, '2022-10-17 00:33:06', '2022-10-17 00:33:06'),
	(2904, 'A preview is an opportunity to see something before it is available to the public.', 'The band played us a preview of their new song.', 2904, 1, '2022-10-17 00:33:21', '2022-10-17 00:33:21'),
	(2905, 'If something is previous, then it happened earlier in time or order.', 'He turned back to the previous page to read the paragraph again.', 2905, 3, '2022-10-17 00:33:34', '2022-10-17 00:33:34'),
	(2906, 'To provide something means to supply it.', 'Each student was provided with a test and three sharp pencils.', 2906, 2, '2022-10-17 00:33:46', '2022-10-17 00:33:46'),
	(2907, 'To recur means to happen more than once.', 'Burglaries seem to recur over and over in our neighborhood.', 2907, 2, '2022-10-17 00:33:57', '2022-10-17 00:33:57'),
	(2908, 'When something is relevant, it is important to a certain person or situation.', 'The thirty-year-old book about politics is still relevant to our society today.', 2908, 3, '2022-10-17 00:34:10', '2022-10-17 00:34:10'),
	(2909, 'A rite is a traditional ceremony carried out by a particular group or society.', 'Special masks are worn during the rite when a new baby is born.', 2909, 1, '2022-10-17 00:34:23', '2022-10-17 00:34:23'),
	(2910, 'To stall means to stop a process and continue it at a later time.', 'If you give the car a push, it won’t stall.', 2910, 2, '2022-10-17 00:34:40', '2022-10-17 00:34:40'),
	(2911, 'If something is supernatural, it is not real or explainable by natural law.', 'The dragon had supernatural powers such as flying and breathing fire.', 2911, 3, '2022-10-17 00:34:54', '2022-10-17 00:34:54'),
