	(3031, 'When something or someone is vicious, they are violent and cruel.', 'The vicious dog tried to bite the small child.', 3031, 3, '2022-10-17 01:41:27', '2022-10-17 01:41:27'),
	(3032, 'If something or someone is absurd, they are ridiculous.', 'That group of people making animal noises sounds completely absurd.', 3032, 3, '2022-10-17 01:42:45', '2022-10-17 01:42:45'),
	(3033, 'Anemia is a blood condition that causes a person to be pale and tired.', 'When she first developed anemia, she became tired often.', 3033, 1, '2022-10-17 01:43:00', '2022-10-17 01:43:00'),
	(3034, 'The aristocracy is the highest class of people in certain societies.', 'Most members of the aristocracy were very well-fed.', 3034, 1, '2022-10-17 01:43:14', '2022-10-17 01:43:14'),
	(3035, 'An aristocrat is a person who is of the highest class in certain societies.', 'The aristocrat did not need a job because his family was wealthy.', 3035, 1, '2022-10-17 01:43:27', '2022-10-17 01:43:27'),
	(3036, 'Attire is nice or special clothing.', 'Everyone wore their best attire to the president’s daughter’s wedding.', 3036, 1, '2022-10-17 01:43:41', '2022-10-17 01:43:41'),
	(3037, 'A craze is a brief and popular activity or object.', 'Wearing bright red socks was a craze when I was in high school.', 3037, 1, '2022-10-17 01:43:54', '2022-10-17 01:43:54'),
	(3038, 'To enlarge something means to make it bigger.', 'The classrooms were enlarged over the summer to make room for more students.', 3038, 2, '2022-10-17 01:44:06', '2022-10-17 01:44:06'),
	(3039, 'An excess is an amount of something that is more than needed or wanted.', 'Because it never got cold that winter, many stores had an excess of coats.', 3039, 1, '2022-10-17 01:44:19', '2022-10-17 01:44:19'),
	(3040, 'If something is feminine, then it has qualities that are commonly related to women.', 'Many of the older people thought his long hair made him look too feminine.', 3040, 3, '2022-10-17 01:44:34', '2022-10-17 01:44:34'),
	(3041, 'A hallmark is a unique characteristic of something.', 'Different types of pasta and tomato sauces are hallmarks of Italian food.', 3041, 1, '2022-10-17 01:44:46', '2022-10-17 01:44:46'),
	(3042, 'A pad is a thick piece of soft material used to protect or clean things.', 'Football players wear shoulder pads to keep them safe.', 3042, 1, '2022-10-17 01:44:59', '2022-10-17 01:44:59'),
	(3043, 'If something is predominant, then it is the most important, common or strongest.', 'Before cars were invented, horses were the predominant method of travel.', 3043, 3, '2022-10-17 01:45:13', '2022-10-17 01:45:13'),
	(3044, 'If someone or something is reputable, then they have a good reputation.', 'The service from the less than reputable company made her angry.', 3044, 3, '2022-10-17 01:45:27', '2022-10-17 01:45:27'),
	(3045, 'Rouge is a red powder or cream used as makeup on the cheeks or lips.', 'Even when she didn’t wear rouge, her cheeks appeared red.', 3045, 1, '2022-10-17 01:45:40', '2022-10-17 01:45:40'),
	(3046, 'To signify means to be a symbol of something.', 'A red octagon is used to signify to stop.', 3046, 2, '2022-10-17 01:45:53', '2022-10-17 01:45:53'),
	(3047, 'A strap is a thin long piece of fabric used to fasten, carry, or hold something.', 'She put the strap of her purse over her shoulder and walked out of the door.', 3047, 1, '2022-10-17 01:46:05', '2022-10-17 01:46:05'),
	(3048, 'A tangle is something or many things twisted together.', 'The laces of his shoes were in such a tangle that he could not untie them.', 3048, 1, '2022-10-17 01:46:16', '2022-10-17 01:46:16'),
	(3049, 'Vanity is excessive pride or love of one’s own appearance or things one has done.', 'Her vanity won’t allow her to pass a mirror without looking at herself.', 3049, 1, '2022-10-17 01:46:32', '2022-10-17 01:46:32'),
	(3050, 'To vie for something means to compete against others for it.', 'The three boys vied for the prize in the chemistry contest.', 3050, 2, '2022-10-17 01:46:50', '2022-10-17 01:46:50'),
	(3051, 'If something or someone is vulgar, then they are rude or lacking in style.', 'Her vulgar behavior got her into trouble with her parents.', 3051, 3, '2022-10-17 01:47:04', '2022-10-17 01:47:04'),
	(3052, 'An attic is a room just below a house’s roof.', 'There were two windows in their attic.', 3052, 1, '2022-10-17 01:47:28', '2022-10-17 01:47:28'),
	(3053, 'A chunk is a thick, solid piece of something.', 'When they broke open the rock, they saw it was filled with chunks of gold.', 3053, 1, '2022-10-17 01:47:40', '2022-10-17 01:47:40'),
	(3054, 'If something is civic, then it is related to a town or city, especially its government.', 'Most of the important civic buildings are located downtown.', 3054, 3, '2022-10-17 01:47:53', '2022-10-17 01:47:53'),
	(3055, 'A descent is a movement downwards.', 'During the space shuttle’s descent, the Earth became larger and larger.', 3055, 1, '2022-10-17 01:48:07', '2022-10-17 01:48:07'),
	(3056, 'A din is loud, unpleasant, and extended noise.', 'The din of the rusty machinery made the factory a horrible place to work.', 3056, 1, '2022-10-17 01:48:21', '2022-10-17 01:48:21'),
	(3057, 'To dissatisfy someone means to fail to please them.', 'He was dissatisfied with his meal.', 3057, 2, '2022-10-17 01:48:33', '2022-10-17 01:48:33'),
	(3058, 'A fuss is excited or annoyed behavior that is not useful in any way.', 'The child made an awful fuss because she didn’t want to go to bed.', 3058, 1, '2022-10-17 01:48:46', '2022-10-17 01:48:46'),
	(3059, 'If food is gourmet, then it is nicer and more expensive than regular food.', 'In order to get a gourmet meal, you have to eat at an expensive restaurant.', 3059, 3, '2022-10-17 01:49:00', '2022-10-17 01:49:00'),
	(3060, 'If something happens hence, then it happens as a result of something.', 'John forgot the key. Hence, we couldn’t open the door.', 3060, 4, '2022-10-17 01:49:15', '2022-10-17 01:49:15'),
	(3061, 'If something is intrinsic, then it is related to the basic nature of that thing.', 'Paper money has no intrinsic value. It is useful simply because society says it is.', 3061, 3, '2022-10-17 01:49:30', '2022-10-17 01:49:30'),
	(3062, 'A kettle is a large metal pot used for boiling liquids or cooking food.', 'The soup was being cooked in a large kettle.', 3062, 1, '2022-10-17 01:49:44', '2022-10-17 01:49:44'),
	(3063, 'A ministry is a government department.', 'The Ministry of Trade is responsible for taxing imports and exports.', 3063, 1, '2022-10-17 01:49:57', '2022-10-17 01:49:57'),
	(3064, 'An ordeal is a bad experience.', 'Driving in the snowstorm was an ordeal she’d never forget.', 3064, 1, '2022-10-17 01:50:10', '2022-10-17 01:50:10'),
	(3065, 'If someone is outspoken, then they are not afraid to say what they think.', 'She was an outspoken critic about the new banking laws.', 3065, 3, '2022-10-17 01:50:25', '2022-10-17 01:50:25'),
	(3066, 'To overwork someone means to make them tired with too much work.', 'After working for three weeks with only one day of rest, Judy was overworked.', 3066, 2, '2022-10-17 01:50:37', '2022-10-17 01:50:37'),
	(3067, 'If something is particular, then it is a single, important part of a group of things.', 'The dress shop didn’t have the particular dress she was looking for.', 3067, 3, '2022-10-17 01:50:53', '2022-10-17 01:50:53'),
	(3068, 'If something is pungent, then it tastes or smells strong and sharp.', 'The garlic made the soup taste so pungent that the chef wouldn’t serve it.', 3068, 3, '2022-10-17 01:51:06', '2022-10-17 01:51:06'),
	(3069, 'To snore means to make a loud noise each time a sleeping person breathes.', 'It was impossible to get to sleep because my husband snored.', 3069, 2, '2022-10-17 01:51:19', '2022-10-17 01:51:19'),
	(3070, 'If something is done soundly, then it is done in the best or most complete way.', 'The nearest opponent was ten meters behind. She won the race soundly.', 3070, 4, '2022-10-17 01:51:33', '2022-10-17 01:51:33'),
	(3071, 'A superintendent is a person who runs a certain department or building.', 'The superintendent decided to close the schools because of the weather.', 3071, 1, '2022-10-17 01:51:48', '2022-10-17 01:51:48'),
	(3072, 'To alternate means to switch back and forth between two things.', 'The best exercise alternates muscle and heart strengthening.', 3072, 2, '2022-10-17 01:52:11', '2022-10-17 01:52:11'),
	(3073, 'If someone is apologetic, they are sorry about something.', 'The boy felt apologetic after losing his sister’s favorite toy.', 3073, 3, '2022-10-17 01:52:27', '2022-10-17 01:52:27'),
	(3074, 'If something or someone is benign, they do not hurt anyone.', 'Many spiders look scary, but most are actually benign.', 3074, 3, '2022-10-17 01:52:43', '2022-10-17 01:52:43'),
	(3075, 'To char means to burn something so that it turns black.', 'While Frank went inside to get the mustard, he accidentally charred the hotdogs.', 3075, 2, '2022-10-17 01:52:56', '2022-10-17 01:52:56'),
	(3076, 'To clarify means to make something easier to understand by explaining it.', 'Drew tried to clarify all the functions of Michelle’s new computer.', 3076, 2, '2022-10-17 01:53:11', '2022-10-17 01:53:11'),
	(3077, 'When someone’s actions are dogged, they try hard to continue something.', 'Her dad bought her a new jacket after her dogged requests for one.', 3077, 3, '2022-10-17 01:53:26', '2022-10-17 01:53:26'),
	(3078, 'Distress is the feeling of being upset or worried.', 'Failing a class caused the student a lot of distress.', 3078, 1, '2022-10-17 01:53:40', '2022-10-17 01:53:40'),
	(3079, 'To ensue means to happen after something.', 'After a few minutes of lightening, thunder ensued.', 3079, 2, '2022-10-17 01:53:52', '2022-10-17 01:53:52'),
	(3080, 'To gasp means to make a noise by quickly breathing in when surprised.', 'John always gasps when watching a scary movie.', 3080, 2, '2022-10-17 01:54:07', '2022-10-17 01:54:07'),
	(3081, 'To negotiate means to try to make an agreement through discussion.', 'Mario and Joe took a long time negotiating the contract between the companies.', 3081, 2, '2022-10-17 01:54:20', '2022-10-17 01:54:20'),
	(3082, 'An overdose is an instance of taking or having too much of something.', 'John’s skin was burned from an overdose of sunshine.', 3082, 1, '2022-10-17 01:54:34', '2022-10-17 01:54:34'),
	(3083, 'Persuasion is the act of making someone do or believe something.', 'The persuasion of his argument convinced the customer to buy the laptop.', 3083, 1, '2022-10-17 01:54:46', '2022-10-17 01:54:46'),
	(3084, 'A relay is a race in which teams of runners or swimmers race against each other.', 'Jerry was the fastest on his team, so he ran the last part of the relay.', 3084, 1, '2022-10-17 01:55:00', '2022-10-17 01:55:00'),
	(3085, 'Reluctance is a feeling of not wanting to do something.', 'Jesse took out the trash with great reluctance.', 3085, 1, '2022-10-17 01:55:13', '2022-10-17 01:55:13'),
	(3086, 'To restate something means to say it again or in a different way.', 'Mrs. Jones restated the test question to the class.', 3086, 2, '2022-10-17 01:55:26', '2022-10-17 01:55:26'),
	(3087, 'Sesame is an herb that is grown for its small seeds and its oil.', 'I used the buns with the sesame seeds on them.', 3087, 1, '2022-10-17 01:55:39', '2022-10-17 01:55:39'),
	(3088, 'To sip something means to drink a small amount at a time.', 'Liza relaxed on the beach, sipping fruit juice through a straw.', 3088, 2, '2022-10-17 01:55:54', '2022-10-17 01:55:54'),
	(3089, 'The verge is the point at which something is about to happen.', 'Joan was on the verge of leaving her house when the phone rang.', 3089, 1, '2022-10-17 01:56:06', '2022-10-17 01:56:06'),
	(3090, 'If someone is wary, they are cautious or mistrusting.', 'She was wary of going to school because she hadn’t done her homework.', 3090, 3, '2022-10-17 01:56:21', '2022-10-17 01:56:21'),
	(3091, 'To waver is to be unable to decide between two choices.', 'I wavered between eating the apple or the cake for a snack.', 3091, 2, '2022-10-17 01:56:33', '2022-10-17 01:56:33'),
	(3092, 'If something goes ashore, it goes from water to the land.', 'After a long day of fishing, Glen pulled his boat ashore, so it wouldn’t float away.', 3092, 4, '2022-10-17 01:57:25', '2022-10-17 01:57:25'),
	(3093, 'To contradict means to state the opposite of what someone else has.', 'Ken was always fighting with his little sister because she kept contradicting him.', 3093, 2, '2022-10-17 01:57:41', '2022-10-17 01:57:41'),
	(3094, 'A counterpart is something that is very similar to something else in what it does.', 'Our manager will meet our rival company’s counterpart later today.', 3094, 2, '2022-10-17 01:57:55', '2022-10-17 01:57:55'),
	(3095, 'When something or someone is devoid of a thing, they are missing it.', 'The movie was devoid of any violence, so it was a perfect movie for the family.', 3095, 3, '2022-10-17 01:58:07', '2022-10-17 01:58:07'),
	(3096, 'To diverge is to become different or to follow a different direction.', 'The road diverged into two paths that led to our houses.', 3096, 2, '2022-10-17 01:58:20', '2022-10-17 01:58:20'),
	(3097, 'To elude means to avoid being caught by something.', 'The rabbit eluded the wolf by hiding in a bush.', 3097, 2, '2022-10-17 01:58:33', '2022-10-17 01:58:33'),
	(3098, 'To fend off something means to push it away and avoid it.', 'Dave spent all night fending off bugs instead of sleeping.', 3098, 2, '2022-10-17 01:58:55', '2022-10-17 01:58:55'),
	(3099, 'When something is fictitious, it is made up and not real.', 'The author said that the characters in her book were completely fictitious.', 3099, 3, '2022-10-17 01:59:08', '2022-10-17 01:59:08'),
	(3100, 'A gazette is a newspaper.', 'Alice wants to write for a gazette when she’s older.', 3100, 1, '2022-10-17 01:59:20', '2022-10-17 01:59:20'),
	(3101, 'If something is homogeneous, it is made up of things which are all the same.', 'All of the houses on Victor’s block were boring and homogenous.', 3101, 3, '2022-10-17 01:59:37', '2022-10-17 01:59:37'),
	(3102, 'To obstruct something means to get in its way.', 'The car broke down on the road and obstructed traffic for hours.', 3102, 2, '2022-10-17 01:59:51', '2022-10-17 01:59:51'),
	(3103, 'To plunge means to move down into something very quickly.', 'The water in the pool was very cold, but the boy plunged in anyway.', 3103, 2, '2022-10-17 02:00:03', '2022-10-17 02:00:03'),
	(3104, 'To prolong means to make something last for a longer time.', 'Sandy walked slowly across the beach, trying to prolong her lunch break.', 3104, 2, '2022-10-17 02:00:15', '2022-10-17 02:00:15'),
	(3105, 'To publicize is to make something get a lot of attention.', 'The company publicized the job positions in the newspaper.', 3105, 2, '2022-10-17 02:00:26', '2022-10-17 02:00:26'),
	(3106, 'If something is sparse, there is not very much of it in a big area.', 'Rob spent Saturday in his garden, clearing out the sparse weeds.', 3106, 3, '2022-10-17 02:00:37', '2022-10-17 02:00:37'),
	(3107, 'A surplus is an extra amount of something.', 'The store sold their surplus items on sale.', 3107, 1, '2022-10-17 02:00:52', '2022-10-17 02:00:52'),
	(3108, 'To theorize means to develop ideas about something.', 'They enjoyed theorizing about how things worked.', 3108, 2, '2022-10-17 02:01:07', '2022-10-17 02:01:07'),
	(3109, 'To verify means to find out if something is true.', 'Julian called the movie theater to verify that the movie started at nine.', 3109, 2, '2022-10-17 02:01:19', '2022-10-17 02:01:19'),
	(3110, 'If something or someone is vigorous, they use a lot of energy.', 'Henry uses vigorous exercise to keep himself in shape.', 3110, 3, '2022-10-17 02:01:33', '2022-10-17 02:01:33'),
	(3111, 'An altar is a table used in churches.', 'The altar had many lit candles on it.', 3111, 1, '2022-10-17 02:02:01', '2022-10-17 02:02:01'),
	(3112, 'Arthritis is an illness causing pain and swelling in a person’s joints.', 'Agatha couldn’t play the piano anymore because of her arthritis.', 3112, 1, '2022-10-17 02:02:14', '2022-10-17 02:02:14'),
	(3113, 'Botany is the study of plants.', 'Gardens are the best places for botany.', 3113, 1, '2022-10-17 02:02:25', '2022-10-17 02:02:25'),
	(3114, 'If something or someone is credible, they can be believed or trusted.', 'Dick gave a credible reason for being late and didn’t get in any trouble.', 3114, 3, '2022-10-17 02:02:40', '2022-10-17 02:02:40'),
	(3115, 'If someone is deceased, they are dead.', 'We visited the graves of our deceased grandparents.', 3115, 3, '2022-10-17 02:02:54', '2022-10-17 02:02:54'),
	(3116, 'Deception is the act of lying or tricking someone.', 'The magic looked very real, but it was only deception.', 3116, 1, '2022-10-17 02:03:06', '2022-10-17 02:03:06'),
	(3117, 'To decipher writing is to figure out what it says.', 'My teacher complained that she couldn’t decipher my essay.', 3117, 2, '2022-10-17 02:03:20', '2022-10-17 02:03:20'),
	(3118, 'Dusk is the time in the evening when it begins to get dark.', 'After dusk, Hannah would catch fireflies in the park.', 3118, 1, '2022-10-17 02:03:39', '2022-10-17 02:03:39'),
	(3119, 'To gratify someone means to please them.', 'Bonnie was gratified after receiving her gift from her parents.', 3119, 2, '2022-10-17 02:04:03', '2022-10-17 02:04:03'),
	(3120, 'To hone something is to improve it and make it very good.', 'Lisa honed her chess skills by hours and hours of practice.', 3120, 2, '2022-10-17 02:04:16', '2022-10-17 02:04:16'),
	(3121, 'To mash something is to crush it so that it is soft.', 'We mashed the hard potatoes and served them for dinner.', 3121, 2, '2022-10-17 02:04:31', '2022-10-17 02:04:31'),
	(3122, 'If something is ornate, it is decorated with a lot of fancy things.', 'Kim’s prom dress was very expensive since it was so ornate.', 3122, 3, '2022-10-17 02:04:44', '2022-10-17 02:04:44'),
	(3123, 'When someone is psychic, they know what will happen or what people think.', 'I think my grandmother has psychic abilities because she can predict anything.', 3123, 3, '2022-10-17 02:05:04', '2022-10-17 02:05:04'),
	(3124, 'If someone is psychotic, they have a very serious mental illness.', 'The psychotic patient believed he saw things that weren’t real.', 3124, 3, '2022-10-17 02:05:17', '2022-10-17 02:05:17'),
	(3125, 'The scope of something is how many people or things it relates to.', 'Modern history has a wide scope.', 3125, 1, '2022-10-17 02:05:32', '2022-10-17 02:05:32'),
	(3126, 'If something or someone is sinister, they are evil.', 'Bad guys in most movies have sinister laughs.', 3126, 3, '2022-10-17 02:05:58', '2022-10-17 02:05:58'),
	(3127, 'Strife is disagreement or fighting between people or groups.', 'There was a lot of strife between Jim and Lisa about what TV show to watch.', 3127, 1, '2022-10-17 02:06:11', '2022-10-17 02:06:11'),
	(3128, 'If something is therapeutic, it helps to cure a disease or makes you healthier.', 'After a stressful day of working, Phoebe would take a therapeutic bath.', 3128, 3, '2022-10-17 02:06:27', '2022-10-17 02:06:27');
INSERT INTO `examples` (`id`, `example`, `word_id`, `created_at`, `updated_at`) VALUES
	(1, 'Laravel is a web application framework with expressive', 3657, '2022-11-27 02:45:17', '2022-11-27 02:45:17'),
	(2, 'A web framework provides a structure and starting point for creating your application', 3658, '2022-11-27 02:46:38', '2022-11-27 02:46:38'),
	(3, 'Allowing you to focus on creating something amazing while we sweat the details', 3659, '2022-11-27 02:47:27', '2022-11-27 02:47:27'),
	(4, 'Laravel strives to provide an amazing developer experience', 3660, '2022-11-27 02:47:52', '2022-11-27 02:47:52'),
	(5, 'Laravel is a framework that can grow with you', 3664, '2022-11-27 02:49:33', '2022-11-27 02:49:33'),
	(6, 'We like to call Laravel a "progressive" framework', 3665, '2022-11-27 02:50:38', '2022-11-27 02:50:38'),
	(7, 'Laravel\'s vast library of documentation', 3666, '2022-11-27 02:51:08', '2022-11-27 02:51:08'),
	(8, 'If you\'re a senior developer, Laravel gives you robust tools for dependency', 3667, '2022-11-27 02:51:35', '2022-11-27 02:51:35'),
	(9, 'A Scalable Framework', 3668, '2022-11-27 02:52:09', '2022-11-27 02:52:09'),
	(10, 'Laravel is incredibly scalable', 3669, '2022-11-27 02:52:26', '2022-11-27 02:52:26'),
	(11, 'Need extreme scaling? Platforms like Laravel Vapor allow you to run your Laravel application at nearly limitless scale on AWS\'s latest serverless technology.', 3671, '2022-11-27 02:53:31', '2022-11-27 02:53:31'),
	(12, 'Thousands of talented developers from around the world', 3672, '2022-11-27 02:54:22', '2022-11-27 02:54:22'),
	(13, 'You may create new Laravel projects by globally installing the Laravel installer via Composer', 3673, '2022-11-27 02:55:09', '2022-11-27 02:55:09'),
	(14, 'Your application will be accessible in your web browser', 3674, '2022-11-27 02:55:40', '2022-11-27 02:55:40'),
	(15, 'We want it to be as easy as possible to get started with Laravel regardless of your preferred operating system', 3675, '2022-11-27 02:56:04', '2022-11-27 02:56:04'),
	(16, 'Laravel Sail is a light-weight command-line interface for interacting with Laravel\'s default Docker configuration', 3679, '2022-11-27 02:57:17', '2022-11-27 02:57:17'),
	(17, 'The Laravel application\'s directory will be created within the directory you execute the command from', 3682, '2022-11-27 02:58:35', '2022-11-27 02:58:35'),
	(18, 'WSL allows you to run Linux binary executables natively on Windows 10', 3684, '2022-11-27 02:59:42', '2022-11-27 02:59:42'),
	(19, 'After installing and enabling WSL2', 3685, '2022-11-27 03:00:10', '2022-11-27 03:00:10'),
	(20, 'Once these tools are installed, you may open any Laravel project by executing the code', 3689, '2022-11-27 03:01:49', '2022-11-27 03:01:49'),
	(21, 'Each option is documented', 3690, '2022-11-27 03:02:58', '2022-11-27 03:02:58'),
	(22, 'Since many of Laravel\'s configuration option values may vary depending on whether your application is running on your local machine or on a production web server, many important configuration values are defined using the .env file that exists at the root of your application.', 3691, '2022-11-27 03:03:49', '2022-11-27 03:03:49'),
	(23, 'The most productive way to use Laravel', 3702, '2022-11-27 03:16:32', '2022-11-27 03:16:32'),
	(24, 'You might be interested in learning about community packages', 3703, '2022-11-27 03:17:04', '2022-11-27 03:17:04'),
	(25, 'She was afraid of the dark.', 1, '2022-12-03 07:18:01', '2022-12-03 07:18:01'),
	(26, 'She was afraid, but never thought of quitting.', 1, '2022-12-03 07:18:01', '2022-12-03 07:18:01'),
	(27, 'I’ve always been afraid of heights.', 1, '2022-12-03 07:18:01', '2022-12-03 07:18:01'),
	(28, 'Dad’s afraid I’ll end up like my cousin.', 1, '2022-12-03 07:18:01', '2022-12-03 07:18:01'),
	(29, 'He’s not afraid of losing.', 1, '2022-12-03 07:18:01', '2022-12-03 07:18:01'),
